		CASE WHEN T2.FECHAACTUALIZACION = '00000000' THEN NULL WHEN T2.FECHAACTUALIZACION IS NOT NULL THEN (CASE WHEN T1.INDICADORBURO = 'C' THEN REPLACE(T2.FECHAACTUALIZACION,'-','') ELSE CONCAT(CONCAT(SUBSTR(T2.FECHAACTUALIZACION,5,4), SUBSTR(T2.FECHAACTUALIZACION,3,2)), SUBSTR(T2.FECHAACTUALIZACION,1,2)) END) ELSE T2.FECHAACTUALIZACION END FECHAACTUALIZACION,
		CASE WHEN T2.FECHAAPERTURACUENTA = '00000000' THEN NULL WHEN T2.FECHAAPERTURACUENTA IS NOT NULL THEN (CASE WHEN T1.INDICADORBURO = 'C' THEN REPLACE(T2.FECHAAPERTURACUENTA,'-','') ELSE CONCAT(CONCAT(SUBSTR(T2.FECHAAPERTURACUENTA,5,4), SUBSTR(T2.FECHAAPERTURACUENTA,3,2)), SUBSTR(T2.FECHAAPERTURACUENTA,1,2)) END) ELSE T2.FECHAAPERTURACUENTA END FECHAAPERTURACUENTA,
		CASE WHEN T2.FECHACIERRECUENTA = '00000000' THEN NULL WHEN T2.FECHACIERRECUENTA IS NOT NULL THEN (CASE WHEN T1.INDICADORBURO = 'C' THEN REPLACE(T2.FECHACIERRECUENTA,'-','') ELSE CONCAT(CONCAT(SUBSTR(T2.FECHACIERRECUENTA,5,4), SUBSTR(T2.FECHACIERRECUENTA,3,2)), SUBSTR(T2.FECHACIERRECUENTA,1,2)) END) ELSE T2.FECHACIERRECUENTA END FECHACIERRECUENTA,
		CASE WHEN T2.FECHAHISTORICAMOROMASGRAVE = '00000000' THEN NULL WHEN T2.FECHAHISTORICAMOROMASGRAVE IS NOT NULL THEN (CASE WHEN T1.INDICADORBURO = 'C' THEN REPLACE(T2.FECHAHISTORICAMOROMASGRAVE,'-','') ELSE CONCAT(CONCAT(SUBSTR(T2.FECHAHISTORICAMOROMASGRAVE,5,4), SUBSTR(T2.FECHAHISTORICAMOROMASGRAVE,3,2)), SUBSTR(T2.FECHAHISTORICAMOROMASGRAVE,1,2)) END) ELSE T2.FECHAHISTORICAMOROMASGRAVE END FECHAHISTORICAMOROMASGRAVE,
		CASE WHEN T2.FECHAINICIOREESTRUCTURA = '00000000' THEN NULL WHEN T2.FECHAINICIOREESTRUCTURA IS NOT NULL THEN (CASE WHEN T1.INDICADORBURO = 'C' THEN REPLACE(T2.FECHAINICIOREESTRUCTURA,'-','') ELSE CONCAT(CONCAT(SUBSTR(T2.FECHAINICIOREESTRUCTURA,5,4), SUBSTR(T2.FECHAINICIOREESTRUCTURA,3,2)), SUBSTR(T2.FECHAINICIOREESTRUCTURA,1,2)) END) ELSE T2.FECHAINICIOREESTRUCTURA END FECHAINICIOREESTRUCTURA,
		CASE WHEN T2.FECHAMASANTIGUAHISTORICOPAGOS = '00000000' THEN NULL WHEN T2.FECHAMASANTIGUAHISTORICOPAGOS IS NOT NULL THEN (CASE WHEN T1.INDICADORBURO = 'C' THEN REPLACE(T2.FECHAMASANTIGUAHISTORICOPAGOS,'-','') ELSE CONCAT(CONCAT(SUBSTR(T2.FECHAMASANTIGUAHISTORICOPAGOS,5,4), SUBSTR(T2.FECHAMASANTIGUAHISTORICOPAGOS,3,2)), SUBSTR(T2.FECHAMASANTIGUAHISTORICOPAGOS,1,2)) END) ELSE T2.FECHAMASANTIGUAHISTORICOPAGOS END FECHAMASANTIGUAHISTORICOPAGOS,
		CASE WHEN T2.FECHAMASRECIENTEHISTORICOPAGOS = '00000000' THEN NULL WHEN T2.FECHAMASRECIENTEHISTORICOPAGOS IS NOT NULL THEN (CASE WHEN T1.INDICADORBURO = 'C' THEN REPLACE(T2.FECHAMASRECIENTEHISTORICOPAGOS,'-','') ELSE CONCAT(CONCAT(SUBSTR(T2.FECHAMASRECIENTEHISTORICOPAGOS,5,4), SUBSTR(T2.FECHAMASRECIENTEHISTORICOPAGOS,3,2)), SUBSTR(T2.FECHAMASRECIENTEHISTORICOPAGOS,1,2)) END) ELSE T2.FECHAMASRECIENTEHISTORICOPAGOS END FECHAMASRECIENTEHISTORICOPAGOS,
		CASE WHEN T2.FECHAREPORTE = '00000000' THEN NULL WHEN T2.FECHAREPORTE IS NOT NULL THEN (CASE WHEN T1.INDICADORBURO = 'C' THEN REPLACE(T2.FECHAREPORTE,'-','') ELSE CONCAT(CONCAT(SUBSTR(T2.FECHAREPORTE,5,4), SUBSTR(T2.FECHAREPORTE,3,2)), SUBSTR(T2.FECHAREPORTE,1,2)) END) ELSE T2.FECHAREPORTE END FECHAREPORTE,
		CASE WHEN T2.FECHAULTIMACOMPRA = '00000000' THEN NULL WHEN T2.FECHAULTIMACOMPRA IS NOT NULL THEN (CASE WHEN T1.INDICADORBURO = 'C' THEN REPLACE(T2.FECHAULTIMACOMPRA,'-','') ELSE CONCAT(CONCAT(SUBSTR(T2.FECHAULTIMACOMPRA,5,4), SUBSTR(T2.FECHAULTIMACOMPRA,3,2)), SUBSTR(T2.FECHAULTIMACOMPRA,1,2)) END) ELSE T2.FECHAULTIMACOMPRA END FECHAULTIMACOMPRA,
		CASE WHEN T2.FECHAULTIMOPAGO = '00000000' THEN NULL WHEN T2.FECHAULTIMOPAGO IS NOT NULL THEN (CASE WHEN T1.INDICADORBURO = 'C' THEN REPLACE(T2.FECHAULTIMOPAGO,'-','') ELSE CONCAT(CONCAT(SUBSTR(T2.FECHAULTIMOPAGO,5,4), SUBSTR(T2.FECHAULTIMOPAGO,3,2)), SUBSTR(T2.FECHAULTIMOPAGO,1,2)) END) ELSE T2.FECHAULTIMOPAGO END FECHAULTIMOPAGO,
		T2.FORMAPAGOACTUAL,
		T2.FRECUENCIAPAGOS,
		T2.GARANTIA,
		T2.HISTORICOPAGOS,
		T2.IDENTIFICADORSOCIEDADINFCRED,
		REPLACE(REPLACE(T2.IMPORTESALDOMOROHISTMASGRAVE,'+',''),'-','') IMPORTESALDOMOROHISTMASGRAVE,
		T2.INDICADORTIPORESPONSABILIDAD,
		T2.LIMITECREDITO,
		T2.MODOREPORTAR,
		T2.MONTOPAGAR,
		T2.MONTOULTIMOPAGO,
		T2.MOPHISTORICOMOROSIDADMASGRAVE,
		T2.NUMEROCUENTAACTUAL,
		T2.NUMEROPAGOS,
		T2.NUMEROPAGOSVENCIDOS,
		T2.REGISTROIMPUGNADO,
		REPLACE(REPLACE(T2.SALDOACTUAL,'+',''),'-','') SALDOACTUAL,
		REPLACE(REPLACE(T2.SALDOVENCIDO,'+',''),'-','') SALDOVENCIDO,
		T2.TIPOCONTRATO,
		T2.TIPOCUENTA,
		T2.TOTALPAGOSCALIFICADOSMOP2,
		T2.TOTALPAGOSCALIFICADOSMOP3,
		T2.TOTALPAGOSCALIFICADOSMOP4,
		T2.TOTALPAGOSCALIFICADOSMOP5,
		T2.TOTALPAGOSREPORTADOS,
		CASE WHEN T2.ULTIMAFECHASALDOCERO = '00000000' THEN NULL WHEN T2.ULTIMAFECHASALDOCERO IS NOT NULL THEN (CASE WHEN T1.INDICADORBURO = 'C' THEN REPLACE(T2.ULTIMAFECHASALDOCERO,'-','') ELSE CONCAT(CONCAT(SUBSTR(T2.ULTIMAFECHASALDOCERO,5,4), SUBSTR(T2.ULTIMAFECHASALDOCERO,3,2)), SUBSTR(T2.ULTIMAFECHASALDOCERO,1,2)) END) ELSE T2.ULTIMAFECHASALDOCERO END ULTIMAFECHASALDOCERO,
		T2.VALORACTIVOVALUACION,
		ROW_NUMBER() OVER(PARTITION BY T1.IDSOLICITUD, T1.NUMEROCONTROLCONSULTA 
		ORDER BY CASE WHEN T1.INDICADORBURO = 'C' THEN REPLACE(COALESCE(T2.FECHAACTUALIZACION,'1900-01-01') ,'-','') ELSE CONCAT(CONCAT(SUBSTR(COALESCE(T2.FECHAACTUALIZACION,'01011900'),5,4), SUBSTR(COALESCE(T2.FECHAACTUALIZACION,'01011900'),3,2)), SUBSTR(COALESCE(T2.FECHAACTUALIZACION,'01011900'),1,2)) END DESC) ORDEN 
	FROM TB_BCRES_ENCABEZADO T1
		LEFT JOIN TB_BCRES_CUENTAS T2 ON T1.IDSOLICITUD = T2.IDSOLICITUD AND T1.NUMEROCONTROLCONSULTA = T2.NUMEROCONTROLCONSULTA
	WHERE T1.IDSOLICITUD IN (
		S0L1C1TUD3S
			) 
) CTAS
GROUP BY CTAS.IDSOLICITUD, CTAS.NUMEROCONTROLCONSULTA, CTAS.FECHAREGISTRO, CTAS.INDICADORBURO

ORDER BY CTAS.IDSOLICITUD
;
